INSERT INTO `om_authority` (`Pk_Authority`, `AuthorityName`, `Description`, `Type`, `Fk_Parent`, `SystemFunction`) VALUES
('0000000001', '应用研发', '该权限管理所有的应用，包括应用过程设计建模，应用过程设计验证，仿真执行，为应用创建版本，上架应用，下架应用等。', NULL, NULL, 'pm'),
('0000000002', '组织管理', '管理系统所有的组织，包括政府、企事业单位，及其结构信息、详细信息、组织结构、岗位管理、工作分配，业绩管理、系统访问授权、职员（员工）管理等。', NULL, NULL, 'om'),
('0000000003', '微服务管理', '管理访问外部应用的微服务，包括创建微服务器、微服务，测试微服务器，测试微服务，上架微服务，下架微服务等。', NULL, NULL, 'am'),
('0000000004', '表单及数据管理', '负责创建和管理表单及基础数据，包括管理参照数据、创建、上架表单、下架表单等。', NULL, NULL, 'fm'),
('0000000005', '应用监控', '实时监控并管理运行中的应用，包括跟踪、修改、恢复、结束、终止、挂起（暂停）应用等操作。', NULL, NULL, 'admin'),
('0000000006', '组织普通用户', '该权限是针对组织内部的非管理用户而设置，其无管理权限，但是可以操作应用，如创建应用执行一笔业务等、操作代办事项以及申请撤回应用执行等。', NULL, NULL, 'client'),
('0000000007', '服务器管理', '实时监控和管理系统中的所有的应用服务器，包括启动、停止、暂停、终止、重启，以及诊断分析服务器状态等。', NULL, NULL, 'svm'),
('0000000008', '大数据管理', '负责统计分析应用运行中所产生的的大数据，以及设置业务智能应用的应用规则。', NULL, NULL, 'bdm'),
('0000000009', '计费管理', '实时监控和管理组织的的应用运行所产生的费用，包括费用预算管理、费用成本计算、费用统计分析等。', NULL, NULL, 'blm');
